import React, { useState } from "react";
import "../../Styles/Shared/NavbarResp.scss";
import logo from "../../Assets/svg/logo.svg";
import SearchIcon from "@material-ui/icons/Search";
import ExpandMoreIcon from "@material-ui/icons/ExpandMore";
import { Link } from "react-router-dom";

function NavbarResp() {
  const [showGames, setShowGames] = useState(false);

  return (
    <div className='navbarResp'>
      <div className='navbarResp__logo'>
        <img src={logo} alt='' />
        <h1>BattleGames</h1>
      </div>
      <div className='navbarResp__content'>
        <h4>Home</h4>

        <h4 onClick={() => setShowGames(!showGames)}>
          Games <ExpandMoreIcon />
        </h4>
        <ul id='aboutUl' style={{ display: showGames ? " block" : "" }}>
          <li>Monster Arena: World</li>
          <li>War Arena: Titan Wars</li>
          <li>Battle Arena: Legends</li>
          <li>Battle Arena: Chess</li>
          <li>Puzzle Arena: Sphere</li>
          <li>Glymber</li>
          <li>Swimaze</li>
        </ul>

        <h4>Shop</h4>

        <h4>Career</h4>
        <h4>About</h4>

        <h4>
          <Link to='/investors'>Blog</Link>
        </h4>
        <h4>
          Support <ExpandMoreIcon />
        </h4>
      </div>
    </div>
  );
}

export default NavbarResp;
